function changeTheme(c,d){let link="styles/themes/"+c+"/"+d+".min.css";$("#theme").attr("href",link)}function initTheme(b){let date=new Date();let theme="light";if((date.getHours()>=18)||(date.getHours()<8)){theme="dark"}if(localStorage.getItem("theme_"+b)){theme=localStorage.getItem("theme_"+b)}changeTheme(theme,b)};